import Layout from '../components/Layout';
import Head from 'next/head';

const Hobbies = () => {

    return (
      <div>
        <Head>
          <title>Tyler's Resume Site</title>
        </Head>
        <Layout>
          <h1>My future hobbies page.</h1>
        </Layout>
      </div>
    );
}

export default Hobbies;
